function App() {
  return (
    <div>
      <Router>
        <div className="App">
          <Navtop />
          <Routes>

            <Route path="/" exact element={<Interaction />}></Route>
            <Route path="/Suggestion" element={<Suggestion />}></Route>
          </Routes>
        </div>
      </Router>
    </div>
  );
}

export default App;
